import React from 'react';
import axios from 'axios';

import './App.css';

import Login from "./components/NotLoggedIn/Login";
// import NotLoggedInMenu from "./components/NotLoggedIn/NotLoggedInMenu";

import Menu from './components/Menu';
import Character from "./components/Character";
import Button from "react-bootstrap/Button";

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            apiBaseUrl: 'http://127.0.0.1:5000/api',
            storedTokens: false,
        }

    }

    // authorize(accessToken, refreshToken) {
    //     window.
    // }

    render() {
        return (
            <div>
            {/*<NotLoggedInMenu />*/}
            <Login apiBaseUrl={this.state.apiBaseUrl}/>
                <Button onClick={console.log(window.localStorage.getItem('access_token'))}>PRINT</Button>
            {/*<Menu />*/}
            {/*<Character />*/}
            </div>
        )
    }
}

export default App;
